function ruleLoaderComplete(e:Event):void {
	var data:String = loader.data;
	Rule.text = data;
}

function mcLoaderComplete(e:Event):void {
	var data:Array = loader.data.split('\n');
	var question:String = data[0] + '\n' + data[1];
	Question.text = question;
	AnswerA.text = 'A.　' + data[2];
	AnswerB.text = 'B.　' + data[3];
	AnswerC.text = 'C.　' + data[4];
	AnswerD.text = 'D.　' + data[5];
	AnswerBtnA1.removeEventListener(MouseEvent.CLICK, highlightAnswerA);
	AnswerBtnA1.removeEventListener(MouseEvent.CLICK, highlightAnswerB);
	AnswerBtnA1.removeEventListener(MouseEvent.CLICK, highlightAnswerC);
	AnswerBtnA1.removeEventListener(MouseEvent.CLICK, highlightAnswerD);
	if (data[6] == '1') {
		AnswerBtnA1.addEventListener(MouseEvent.CLICK, highlightAnswerA);
	} else if (data[6] == '2') {
		AnswerBtnA1.addEventListener(MouseEvent.CLICK, highlightAnswerB);
	} else if (data[6] == '3') {
		AnswerBtnA1.addEventListener(MouseEvent.CLICK, highlightAnswerC);
	} else if (data[6] == '4') {
		AnswerBtnA1.addEventListener(MouseEvent.CLICK, highlightAnswerD);
	}
}

function B1An(e:Event):void {
	;
}

function sqLoaderComplete(e:Event):void {
	var data:Array = loader.data.split('\n');
	var question:String = data[0] + '\n' + data[1];
	Question.text = question;
	B1.text = data[2];
	AnswerBtnB1.removeEventListener(MouseEvent.CLICK, showAnswer);
	AnswerBtnB1.addEventListener(MouseEvent.CLICK, showAnswer);
}

function showAnswer(e:Event):void {
	B1.visible = true;
}

function highlightAnswerA(e:Event):void {
	AnswerA.textColor = 0xff0000;
	AnswerB.alpha = .25;
	AnswerC.alpha = .25;
	AnswerD.alpha = .25;
}

function highlightAnswerB(e:Event):void {
	AnswerB.textColor = 0xff0000;
	AnswerA.alpha = .25;
	AnswerC.alpha = .25;
	AnswerD.alpha = .25;
}

function highlightAnswerC(e:Event):void {
	AnswerC.textColor = 0xff0000;
	AnswerA.alpha = .25;
	AnswerB.alpha = .25;
	AnswerD.alpha = .25;
}

function highlightAnswerD(e:Event):void {
	AnswerD.textColor = 0xff0000;
	AnswerA.alpha = .25;
	AnswerB.alpha = .25;
	AnswerC.alpha = .25;
}

function musicLoaderComplete(e:Event):void {
	var data:Array = loader.data.split('\n');
	var position:String = '';
	if (data[6] == '1') {
		position = '';
	} else if (data[6] == '2') {
		position = 'OP';
	} else if (data[6] == '3') {
		position = 'ED';
	} else if (data[6] == '4') {
		position = '挿入歌';
	}
	var result:String = '♪ ' + data[1] + '　「' + data[0] + '」' + position;
	musicAnswer.text = result;
}

function tfLoaderComplete(e:Event):void {
	var data:Array = loader.data.split('\n');
	var question:String = data[0] + '\n' + data[1];
	Question.text = question;
	AnswerBtn.removeEventListener(MouseEvent.CLICK, revealTrue);
	AnswerBtn.removeEventListener(MouseEvent.CLICK, revealFalse);
	if (data[6] == '1') {
		AnswerBtn.addEventListener(MouseEvent.CLICK, revealTrue);
	} else if (data[6] == '2') {
		AnswerBtn.addEventListener(MouseEvent.CLICK, revealFalse);
	}
}

function picLoaderComplete(e:Event):void {
	var data:Array = loader.data.split('\n');
	var answer:String = data[0];
	Answer.text = answer;
}

function revealTrue(e:Event):void {
	trueSymbol.visible = true;
}

function revealFalse(e:Event):void {
	falseSymbol.visible = true;
}

function loaderIOErrorHandler(e):void {
	nextFrame();
}

